import React ,{ useState } from "react";
import './App.css';

function App(){
  const [users, userDetails] = useState([]);

  const [isLoading, setLoading] = useState(false);

  const  loadUsers = () => {
    setLoading(true);
    fetch('https://reqres.in/api/users?page=1')
      .then((response) => response.json())
      .then((json) => {
        console.log(json.data);
        userDetails(json.data);
      });
    setTimeout(() => {
      setLoading(false);
    }, 1000);
  };

  return (
    <div className="App">
      <h1>hello</h1>
      <button onclick={loadUsers}>GET DATA</button>
      <h2>USERS:</h2>
      <ul>
        {users.map((id,first_name) =>(
         <li key={id}>
           Name:{first_name}
           </li>
        ))}
      </ul>
    </div>
  );
}
export default App;
